import { Link } from "react-router-dom"; // Import Link
import "./header.css"

export default function Header() {
  return (
    <>
    <nav>
      <img src="./images/pic13.png" alt=""  className="image"/>
      <ul className="nav-menu">
      <li><Link to="./home">Home</Link></li>
      <li><Link to="./home">About Us</Link></li>
      <li><Link to="./home">Course</Link></li>
      <li><Link to="./home">Contact Us</Link></li>
      <li><button>Join Class</button></li>
      <li><button>Book A Free Trial</button></li>
      </ul>
 
      </nav>
    </>
  );
}
